import React from "react";
import FormularioVendedor from "../components/FormularioVendedor";

function PaginaVendedores() {
  return (
    <div>
      <h1 className="text-2xl font-bold text-blue-600 mb-6 text-center">Alta de Vendedor</h1>
      <FormularioVendedor />
    </div>
  );
}

export default PaginaVendedores;
